  `USER_ID` bigint(20) NOT NULL,
  `ROLE_ID` int(11) NOT NULL,
  PRIMARY KEY (`USER_ID`,`ROLE_ID`),
  KEY `FK_USERS_AUTHORITIES_AUTHORITY` (`ROLE_ID`),
  CONSTRAINT `FK_USERS_AUTHORITIES_AUTHORITY` FOREIGN KEY (`ROLE_ID`) REFERENCES `AUTHORITY` (`ID`),
  CONSTRAINT `FK_USERS_AUTHORITIES_USER_` FOREIGN KEY (`USER_ID`) REFERENCES `USER_` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

